import React from "react";

export const GridItem = ({ title, description }) => {
  return (
    <div>
      <h1>{title}</h1>
      <p>{description}</p>
    </div>
  );
}

export const GridItemWithImage = ({ title, description, image, alt }) => {
  return (
    <div>
      <h1>{title}</h1>
      <p>{description}</p>
      <img src={image} alt={alt} />
    </div>
  );
}
